existence.query:
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX owl: <http://www.w3.org/2002/07/owl#>

ASK {
    <http://example.org/ontology/Subject> rdf:type owl:Class .
}

PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX owl: <http://www.w3.org/2002/07/owl#>

ASK {
    <http://example.org/ontology/Subject_name> rdf:type owl:DatatypeProperty ;
    rdfs:domain <http://example.org/ontology/Subject> .
}

usage.query:
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX owl: <http://www.w3.org/2002/07/owl#>

SELECT (
    (
        (COUNT(DISTINCT ?subject)) / count(DISTINCT ?subject2)
    ) AS ?usage
)
WHERE {
    OPTIONAL { 
        ?subject a <http://example.org/ontology/Subject> .
        ?subject <http://example.org/ontology/Subject_name> ?value .
    }
    ?subject2 a <http://example.org/ontology/Subject> .
}

presence_per_instance.query:
