PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX owl: <http://www.w3.org/2002/07/owl#>

SELECT ?instance (COUNT(?value) AS ?presence)
WHERE {
    ?instance a <http://example.org/ontology/Subject> .
    OPTIONAL { 
        ?instance <http://example.org/ontology/Subject_name> ?value .
    }
} GROUP BY ?instance

